@import "mixins";

$dark-blue: rgba(31, 32, 65, 0.5);
$dark-blue-75: rgba(31, 32, 65, 0.75);

.inputs__text-1 {
  @include text-position($width: 80px, $height: 15px, $left: 141px, $top: 130px);
  @include text-bold-properties();
}

.inputs__text-01 {
  @include text-position($width: 57px, $height: 15px, $left: 403.74px, $top: 130px);
  @include text-properties($font-size: 12px, $line-height: 15px, $color: $dark-blue);

  text-align: right;
  text-transform: uppercase;
}

.inputs__text-field_default {
  position: absolute;
  width: 320px;
  height: 44px;
  left: 141px;
  top: 163px;

  @include rectangle-properties();
}

.inputs__text-field_default::placeholder {
  position: relative;
  left: 15px;

  @include text-properties();
}

.inputs__text-2 {
  @include text-position($width: 72px, $height: 15px, $left: 141px, $top: 214.44px);
  @include text-bold-properties();
}

.inputs__text-02 {
