  @include text-properties($font-size: 12px, $line-height: 15px, $color: $dark-blue);

  text-align: right;
  text-transform: uppercase;
}

.inputs__text-field_hover {
  position: absolute;
  width: 320px;
  height: 44px;
  left: 141px;
  top: 247.44px;

  @include rectangle-properties($border-color: $dark-blue);
}

.inputs__text-field_hover::placeholder {
  position: relative;
  left: 15px;

  @include text-properties($line-height: 18px, $color: $dark-blue-75);
}

.inputs__text-3 {
  @include text-position($width: 81px, $height: 15px, $left: 141px, $top: 298.44px);
  @include text-bold-properties();
}

.inputs__dropdown {
  position: absolute;
  width: 320px;
  height: 44px;
  left: 141px;
  top: 331.44px;

  @include rectangle-properties();
}

.inputs__dropdown::placeholder {
  position: relative;
  left: 15px;

  @include text-properties($line-height: 18px, $color: $dark-blue-75);
}

.inputs__text-4 {
  @include text-position($width: 130px, $height: 15px, $left: 141px, $top: 385px);
  @include text-bold-properties();
}

.inputs__masked-text-field {
  position: absolute;
  width: 320px;
  height: 44px;
  left: 141px;
  top: 418px;

  @include rectangle-properties();
}

.inputs__masked-text-field::placeholder {
  position: relative;
  left: 15px;

  @include text-properties();
}

